    n = len(a)
    unused = [1] * k

    def ng():
        return 'IMPOSSIBLE'
    try:
        for i in range(n):
            if a[i] == '?' and a[n - i - 1] != '?':
                a[i] = a[n - i - 1]
            if a[i] != '?':
                unused[ord(a[i]) - 0] = 0
    except IndexError:
        return ng()
    for i in range(n):
        if a[i] != a[n - i - 1]:
            return ng()
    for i in range(n // 2, n):
        if a[i] == '?':
            for cc in range(k - 1, -1, -1):
                if unused[cc]:
                    a[i] = a[n - i - 1] = chr(cc + 97)
                    unused[cc] = 0
                    break
            else:
                a[i] = a[n - i - 1] = 'a'
    if any(unused):
        return ng()
    return ''.join(a)

